import styled from "styled-components";

export const MyWorkArrow = styled.div`
  padding: 17px 174px 0;
  display: flex;
  flex-direction: column;
  align-items: center;
  z-index: 10;
`;
export const Arrow = styled.div`
  padding: 10px 0 100px 10px;
  display: flex;
  align-items: flex-start;
`;
export const MyWork = styled.p`
  max-width: 227px;
  font-family: "Kumar One";
  font-size: 42px;
  font-weight: 400;
  line-height: normal;
  color: ${(props) => props.theme.colors.white};
`;
